import React from "react";

function HeroComponent() {
  return (
    <React.Fragment>
        <div className="hero-section">
            <h1>Program</h1>
            <h3>Get Immersed in Neuroscience</h3>
            <p>A 6-week journey into the world of neuroscience designed to make complex brain science simple, exciting, and accessible for curious minds.</p>
         </div>
    </React.Fragment>
  );
}

export default HeroComponent;
